import React from 'react';
import { Navbar, Nav, Container, Button } from 'react-bootstrap';
import { Link, useNavigate, useLocation } from 'react-router-dom';
import { useAuth } from '../context/AuthContext';
import Header from './Header';

const Navigation = () => {
  const { user, isAuthenticated, logout } = useAuth();
  const navigate = useNavigate();
  const location = useLocation();

  const handleLogout = () => {
    logout();
    navigate('/');
  };

  const getRoleBadgeClass = (role) => {
    switch (role) {
      case 'ADMIN':
        return 'role-badge-admin';
      case 'TRAINER':
        return 'role-badge-trainer';
      case 'STAFF':
        return 'role-badge-staff';
      case 'MEMBER':
        return 'role-badge-member';
      default:
        return 'role-badge';
    }
  };

  return (
    <>
      {!isAuthenticated ? (
        <Header /> // <- Show landing header when not logged in
      ) : (
        <Navbar bg="dark" variant="dark" expand="lg">
          <Container>
            <Navbar.Brand as={Link} to="/">🏋️ Gym Management System</Navbar.Brand>
            <Navbar.Toggle aria-controls="basic-navbar-nav" />
            <Navbar.Collapse id="basic-navbar-nav">
              <Nav className="me-auto">
                <Nav.Link as={Link} to="/" className={location.pathname === '/' ? 'active' : ''}>
                  Home
                </Nav.Link>

                <Nav.Link as={Link} to="/profile" className={location.pathname === '/profile' ? 'active' : ''}>
                  Profile
                </Nav.Link>

                {user?.role === 'MEMBER' && (
                  <Nav.Link as={Link} to="/member" className={location.pathname === '/member' ? 'active' : ''}>
                    Member Dashboard
                  </Nav.Link>
                )}
                {user?.role === 'TRAINER' && (
                  <Nav.Link as={Link} to="/trainer" className={location.pathname === '/trainer' ? 'active' : ''}>
                    Trainer Dashboard
                  </Nav.Link>
                )}
                {user?.role === 'STAFF' && (
                  <Nav.Link as={Link} to="/staff" className={location.pathname === '/staff' ? 'active' : ''}>
                    Staff Dashboard
                  </Nav.Link>
                )}
                {user?.role === 'ADMIN' && (
                  <Nav.Link as={Link} to="/admin" className={location.pathname === '/admin' ? 'active' : ''}>
                    Admin Dashboard
                  </Nav.Link>
                )}

                {(user?.role === 'ADMIN' || user?.role === 'STAFF') && (
                  <>
                    <Nav.Link as={Link} to="/memberships">Memberships</Nav.Link>
                    <Nav.Link as={Link} to="/equipment">Equipment</Nav.Link>
                    <Nav.Link as={Link} to="/gym-classes">Classes</Nav.Link>
                    <Nav.Link as={Link} to="/payments">Payments</Nav.Link>
                  </>
                )}

                {(user?.role === 'ADMIN' || user?.role === 'STAFF' || user?.role === 'TRAINER') && (
                  <>
                    <Nav.Link as={Link} to="/training-sessions">Training Sessions</Nav.Link>
                    <Nav.Link as={Link} to="/class-registrations">Registrations</Nav.Link>
                  </>
                )}

                <Nav.Link as={Link} to="/test-auth">Test Auth</Nav.Link>
              </Nav>

              <Nav>
                <span className="navbar-text me-3">
                  Welcome, {user?.firstName} {user?.lastName}
                  <span className={`ms-2 ${getRoleBadgeClass(user?.role)}`}>
                    {user?.role}
                  </span>
                </span>
                <Button variant="outline-light" onClick={handleLogout}>
                  Logout
                </Button>
              </Nav>
            </Navbar.Collapse>
          </Container>
        </Navbar>
      )}
    </>
  );
};

export default Navigation;
